#include "autd3/link/soem.hpp" int main() try { // create and open controller auto autd = // The argument is the position. // The position is the origin of the device in the global // coordinate system you set. autd3::ControllerBuilder({autd3::AUTD3(autd3::Vector3::Zero())}) .open(autd3::link::SOEM::builder().with_err_handler([](const uint16_t slave, const autd3::link::Status status, const std::string& msg) { switch (status) { case autd3::link::Status::Error: std::cout << "Error [" << slave << "]: " << msg << std::endl; break; case autd3::link::Status::Lost: std::cout << "Lost [" << slave << "]: " << msg << std::endl; // You can also wait for the link to recover, // without exiting the process exit(-1); case autd3::link::Status::StateChanged: std::cout << "StateChanged [" << slave << "]: " << msg << std::endl; break; } })); // check firmware version const auto firm_version = autd.firmware_version(); std::copy(firm_version.begin(), firm_version.end(), std::ostream_iterator<autd3::FirmwareVersion>(std::cout, "\n")); // Silencer is used to quiet down the transducers' noise by passing the // phase/amplitude parameters through a low-pass filter. autd.send(autd3::Silencer()); // focus is 150.0 mm above array center const autd3::Vector3 focus = autd.geometry().center() + autd3::Vector3(0, 0, 150); autd3::gain::Focus g(focus); // Amplitude Modulation of 150 Hz sine wave autd3::modulation::Sine m(150 * autd3::Hz); // send data autd.send((m, g)); std::cout << "press enter to finish..." << std::endl; std::cin.ignore(); // close controller autd.close(); return 0;
} catch (std::exception& ex) { std::cerr << ex.what() << std::endl;
} Then, build with CMake. mkdir build
cd build
cmake .. -DCMAKE_BUILD_TYPE=Release
cmake --build . --config Release Finally, run the program. .\Release\main.exe sudo ./main Found a bug? Edit this page on GitHub.

