{ private readonly Vector3 _point; public FocalPoint(Vector3 point) { _point = point; } private Func<Device, Func<Transducer, Drive>> Calc(Geometry geometry) { return Transform(dev => tr => { var tp = tr.Position; var dist = (tp - _point).L2Norm; var phase = dist * dev.Wavenumber; return new Drive { Phase = new Phase(phase * rad), Intensity = EmitIntensity.Max }; }); }
} from collections.abc import Callable import numpy as np
