Holo is a Gain for generating multiple foci. Several algorithms for generating multiple foci have been proposed, and the following algorithms are implemented in SDK. SDP - Semi-definite programming, based on Inoue et al. [1] Naive - Linear synthesis of single-focus solutions GS - Gershberg-Saxon, based on Marzo et al. [2] GSPAT - Gershberg-Saxon for Phased Arrays of Transducers, based on Plasencia et al. [3] LM - Levenberg-Marquardt, LM method proposed by Levenberg [4] and Marquardt [5] for optimization of nonlinear least-squares problems, implementation based on Madsen's text [6] Greedy - Greedy algorithm and Brute-force search, based on Suzuki et al. [7] You can select the backend for the calculation of the algorithm from the following. NalgebraBackend - uses Nalgebra CUDABackend - uses CUDA, which runs on GPUs # use autd3::prelude::*;
